  \"Aerial Image over Flint Hills National Wildlife Refuge, Acquired on March 22,
  1950 (Frame 1685)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:52:23.302331\",\n\t\"name\": \"aerial-image-over-flint-hills-national-wildlife-refuge-acquired-on-march-22-1950-frame-168-a58a6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Georeferenced image, acquired on March
  22, 1950, over a portion of the Flint Hills National Wildlife Refuge. Image covers
  the central portion of the refuge including the town of Hartford, and areas now
  inundated by John Redmond Reservoir. This data set is a georeferenced version of
  an original black and white aerial photograph downloaded from Earth Explorer. The
  original photo was georeferenced against the Coffey and Lyon County 2012 NAIP images.
  This frame occurs within both Coffey and Lyon Counties. This data set, in addition
  to the one in 1948, provides an interesting look back in time prior to the establishment
  of the John Redmond Dam and Reservoir on the Neosho River. The dam was authorized
  in 1950, with construction starting in 1959, and completion in late 1964, Flint
  Hills NWR was established in 1966. This image allows a look at habitats including
  which areas were cropped, native prairie, and woodlands, prior to the reservior
  completion. Major changes ensued in the surrounding landscape following closure
  of the dam. This image is being used by refuge staff to assist in understanding
  and visualizing the historical content of the lands within the refuge. Pixel resolution
  of this image is 5 meters. This image should be used for resource-level interpretation
  only.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
